import React, { Component } from 'react'

class GroupStatistics extends Component {

    Welcome(props) {
        return <h1>Hello, {props.name}</h1>;
    }

    render() {
        let { results } = this.props
        return (
            <div>
                {results.map(() => (<p>Hello</p>))}
            </div>
        )
    }
}

export default GroupStatistics
